import React from "react";


export default function Phonetic (props){
    console.log(props.phonetic);
    return (
        <div className="Phonetic">
         <a href={props.phonetic.audio} target="_blank">Audio</a>  

       <br />

       {props.phonetic.text}
        </div>
    )
}
